from typing import Optional, Dict

class LocationData():
    address: Optional[int]
    region: str
    key: Optional[str]
    content: Optional[str]
    
    def __init__(self, address: Optional[int] = None, region: Optional[str] = "Menu", key: Optional[str] = None, content: Optional[str] = None):
        self.address = address
        self.region = region
        self.key = key
        self.content = content

class EntranceData():
    region: str
    key: Optional[str]
    source: Optional[str]
    destination: Optional[str]
    
    def __init__(self, region: Optional[str] = "Menu", key: Optional[str] = None, source: Optional[str] = None, destination: Optional[str] = None):
        self.region = region
        self.key = key
        self.source = source
        self.destination = destination

class StaticEntranceData():
    region: str
    region_to: Optional[str]

    def __init__(self, region: Optional[str] = "Menu", region_to: Optional[str] = None):
        self.region = region
        self.region_to = region_to

